/********************************************************************
 * FUNCTION intri_device_intri_device_mro
 *
 * Make read-only top-level node
 * Path: /intri-device
 *
 * RETURNS:
 *     error status
 ********************************************************************/
static status_t
intri_device_intri_device_mro(void)
{
  val_value_t *parentval = NULL, *childval = NULL;
  status_t res = NO_ERR;

  /* add /intri-device */
  res = agt_add_top_container(intri_device_obj, &parentval);
  if (res != NO_ERR)
  {
    return res;
  }
  res = agt_add_container(
      y_intri_device_M_intri_device,
      y_intri_device_N_get_mac_addr,
      parentval,
      &childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = intri_device_intri_device_get_mac_addr_mro(childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = agt_add_container(
      y_intri_device_M_intri_device,
      y_intri_device_N_get_port_list,
      parentval,
      &childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = intri_device_intri_device_get_port_list_mro(childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = agt_add_container(
      y_intri_device_M_intri_device,
      y_intri_device_N_get_lag_port_list,
      parentval,
      &childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = intri_device_intri_device_get_lag_port_list_mro(childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = agt_add_container(
      y_intri_device_M_intri_device,
      y_intri_device_N_get_poe_port_list,
      parentval,
      &childval);
  if (res != NO_ERR)
  {
    return res;
  }

  res = intri_device_intri_device_get_poe_port_list_mro(childval);
  if (res != NO_ERR)
  {
    return res;
  }

  return res;

} /* intri_device_intri_device_mro */

/********************************************************************
 * FUNCTION y_intri_device_init
 *
 * initialize the intri-device server instrumentation library
 *
 * INPUTS:
 *    modname == requested module name
 *    revision == requested version (NULL for any)
 *
 * RETURNS:
 *     error status
 ********************************************************************/
status_t y_intri_device_init(
    const xmlChar *modname,
    const xmlChar *revision)
{
  status_t res = NO_ERR;
  agt_profile_t *agt_profile = agt_get_profile();

  y_intri_device_init_static_vars();

  /* change if custom handling done */
  if (xml_strcmp(modname, y_intri_device_M_intri_device))
  {
    return ERR_NCX_UNKNOWN_MODULE;
  }

  if (revision && xml_strcmp(revision, y_intri_device_R_intri_device))
  {
    return ERR_NCX_WRONG_VERSION;
  }
  res = ncxmod_load_module(
      y_intri_device_M_intri_device,
      y_intri_device_R_intri_device,
      &agt_profile->agt_savedevQ,
      &intri_device_mod);
  if (res != NO_ERR)
  {
    return res;
  }

  intri_device_obj = ncx_find_object(
      intri_device_mod,
      y_intri_device_N_intri_device);
  if (intri_device_mod == NULL)
  {
    return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
  }
  /* put your module initialization code here */

  return res;
} /* y_intri_device_init */

